/*Table structure for table `credit_card_payments` */

DROP TABLE IF EXISTS `credit_card_payments`;

CREATE TABLE `credit_card_payments` (
  `credit_card_payment_id` int(11) NOT NULL AUTO_INCREMENT,
  `payment_id` int(11) NOT NULL,
  `credit_card_number` varchar(31) COLLATE utf8_unicode_ci NOT NULL,
  `amount` double NOT NULL,
  PRIMARY KEY (`credit_card_payment_id`),
  UNIQUE KEY `credit_card_payment_id_UNIQUE` (`credit_card_payment_id`),
  KEY `fk_credit_card_payments_payments1_idx` (`payment_id`),
  CONSTRAINT `fk_credit_card_payments_payments1` FOREIGN KEY (`payment_id`) REFERENCES `payments` (`payment_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `credit_card_payments` */

/*Table structure for table `enrollments` */

DROP TABLE IF EXISTS `enrollments`;

CREATE TABLE `enrollments` (
  `enrollment_id` int(11) NOT NULL AUTO_INCREMENT,
  `payment_id` int(11) NOT NULL,
  `student_id` int(11) NOT NULL,
  `course_id` int(11) NOT NULL,
  `enrollment_date` datetime NOT NULL,
  `enrollment_status` tinyint(4) NOT NULL,
  PRIMARY KEY (`enrollment_id`),
  UNIQUE KEY `enrollment_id_UNIQUE` (`enrollment_id`),
  KEY `fk_enrollments_students1_idx` (`student_id`),
  KEY `fk_enrollments_courses1_idx` (`course_id`),
  CONSTRAINT `fk_enrollments_courses1` FOREIGN KEY (`course_id`) REFERENCES `courses` (`course_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_enrollments_students1` FOREIGN KEY (`student_id`) REFERENCES `students` (`student_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

